  false,\n\t\"url\": null,\n\t\"notes\": \"The EnviroAtlas Climate Scenarios were
  generated from NASA Earth Exchange (NEX) Downscaled Climate Projections (NEX-DCP30)
  ensemble averages (the average of over 30 available climate models) for each of
  the four representative concentration pathways (RCP) for the contiguous U.S. at
  30 arc-second (approx. 800 m2) spatial resolution. NEX-DCP30 mean monthly precipitation
  rate for the 4 RCPs (2.6, 4.5, 6.0, 8.5) were organized by season (Winter, Spring,
  Summer, and Fall) and annually for the years 2006 u00e2?? 2099. Additionally, mean
  monthly precipitation rate for the ensemble average of all historic runs is organized
  similarly for the years 1950 u00e2?? 2005. This dataset was produced by the US EPA
  to support research and online mapping activities related to EnviroAtlas. EnviroAtlas
  (https://www.epa.gov/enviroatlas) allows the user to interact with a web-based,
  easy-to-use, mapping application to view and analyze multiple ecosystem services
  for the contiguous United States. The dataset is available as downloadable data
  (https://edg.epa.gov/data/Public/ORD/EnviroAtlas) or as an EnviroAtlas map service.
  Additional descriptive information about each attribute in this dataset can be found
  in its associated EnviroAtlas Fact Sheet (https://www.epa.gov/enviroatlas/enviroatlas-fact-sheets).\",\n\t\"license_title\":
